INSERT INTO `albums` (`album_id`, `album_title`, `album_artist`, `release_date`, `image_url`, `credits`, `artist_email`) VALUES (17,'doing it 6',2,'2018-11-04','https://waylostreams.live/album-covers/step0001.jpg','top cd',''),(34,'demos',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/a3585092420_10.jpg','what a great cd isnt it ','seanwayland@gmail.com'),(35,'1999',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/1999.jpg','released January 1, 2000   Recorded August 1999 at Sound on Sound, NYC   Alvester Garnett Drums  Seamus Blake Saxophone  Steve Kirby Bass  Sam Lipman Tenor 2, 5  Pete Rendi Pedal Steel  Jesse Harris 1, 2, 3  Greg Gonsales Drums 1, 2  Mike Davis Bass 12  Nick McBride Drums 6, 13, 15  Brett Hirst Bass 6, 13, 15  James Muller Guitar 6, 12, 13, 15','seanwayland@gmail.com'),(36,'australian rhythm changes',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/australianrhythmchanges.jpg','Australian Rhythm took quite some time to finish (over 2 years). I recorded it here in Sydney. I did a number of sessions in various studios here. 4 of the tracks feature the band of Chad Wackerman, James Muller and Brett Hirst. We recorded with engineer Guy Dickerson at Chad\'s studio. Sadly Chad has returned back to L.A. I feel fortunate to have had the opportunity to work with him here. He really is an unbelievable musician with an original approach. The album was an opportunity to experiment with Synthesizers. Allan Holdsworth\'s CD \"Flat Tire\" really knocked me out and proved to me that synths can be beautiful if used creatively. Getting Chad involved seemed like a great idea especially because of his involvement with Allan, and because he was leaving and I could see that the opportunity might not arise again.  The first sessions that I used on ARC involved Nick McBride. We did some recording with Mike Bartolomei at his \"one chook\" studio. I played bass on my little \"Voce\" organ module and I overdubbed the rest on my home computer. The other sessions where recorded at Electric ave studios and the engineer was Phil Punch. The drummers at Electric Ave where Felix Bloxsom and Andrew Gander with Brett Hirst and Phil Stack. I played some duets with the drummers on Clayton Doley\'s Hammond C3 which lives at Phil\'s studio. Track 2 \"ARC 1\" was supposed to be incorporated into \"ARC 2\" but was so funny that it seemed to stand up better by itself.   I wanted to have a live feel but have the opportunity to overdub. We played live in the studio and included improvisations but left space for further solos. All the Synthesizer studios where overdubbed. I used plenty of different keyboards, including:   Fender Rhodes, Yamaha C2 acoustic grand, Hammond C3, Yamaha QY70, OBerheim matrix 1000, Oberheim Xpander and Voce V5 organ module.   James Muller www.jamesmuller.com played some great solos which we recorded at my house  credits released January 1, 2005   chad wackerman ( drums ) : 3 , 11 , 8 , 17  nick mcbride ( drums) : 7 , 13  andrew gander ( drums ) : 2 , 4 , 9 , 12 , 15  brett hirst : ( bass ) : 3 , 6 , 11 , 8 , 17  phil stack : ( bass ) : 1 , 4 , 9 , 15  james muller ( guitar ) : 1 , 3 , 6 , 8 , 11','seanwayland@gmail.com'),(37,'barrenjoey',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/barrenjoey.jpg','Recording Studios: Avatar, Systems Two, The Studio.  Recorded between 2007 and June 2012.  Sean\'s keyboards: Steinway piano, Fender rhodes 54,  Nord Modular G2X, Oberheim xpander,  Oberheim Matrix 1000, Hammond B3 organ,  Yamaha QY70.    Thanks to Qing, my family and the musicians.    Some of this music was composed for instruments  designed before 1975.  Some of this music is corny fusion music.     This CD was self-funded, including funds  generated from the sales of previous CDs recorded  and paid for by myself. credits released October 21, 2013   Mark Guiliana - drums (4, 9, 13, 14, 15, 16, 17, 18)  Keith Carlock - drums (1, 2, 3, 5, 6, 7, 8, 10, 11, 15, 19)  Alex Hewetson - bass (19)  Jeff Hanley - bass (1-19)  Nate Wood - guitar (1-19)  Michael Valenue -guitar (6, 7, 15)  Luca Benedetti - guitar (16)  James Muller - guitar solo (10)  Mike Rivett - sax solo (4)  Jon Gordon - sax solo (6)  Ben Wendel - bassoon (7)  Sean Wayland - vocals, keys, composer  Virna Sanzone - vocals ( 1,2,5)    Recording and mixing Engineers: Aya Takemura, Mike Marciano,  Jon Rosenberg, Nick Moran, Nate Wood, Sean Wayland  Mastered by Sean Wayland   www.seanwayland.com  Seed CD 021 license','seanwayland@gmail.com'),(38,'surf music chiko roll ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/chiko.jpg','Recording Studios: Avatar, Systems Two, The Studio.  Recorded between 2007 and June 2012.  Sean\'s keyboards: Steinway piano, Fender rhodes 54,  Nord Modular G2X, Oberheim xpander,  Oberheim Matrix 1000, Hammond B3 organ,  Yamaha QY70.    Thanks to Qing, my family and the musicians.    Some of this music was composed for instruments  designed before 1975.  Some of this music is corny fusion music.     This CD was self-funded, including funds  generated from the sales of previous CDs recorded  and paid for by myself.   Back in 2001 I used to work in a mental institution in Queens New York as a music therapist. I worked with mostly black and hispanic teenagers who where dual diagnosis ( low IQ and mentally ill in some way also ). A good deal of them seemed to be only interested in Hip Hop and eating fried chicken. As an Australian growing up on a diet of Michael Jackson and the Cosby show it was quite a shock. The system was poorly funded and a lot of people working there...  more credits released October 22, 2013   Mark Guiliana - drums (1, 2, 3, 4, 6, 7, 8, 9, 10, 11)  Keith Carlock - drums (5, 13, 14)  Jeff Hanley - electric bass (1-13)  Alex Hewetson - electric bass (14)  Nate Wood - guitar  Isaac Darche - guitar solo (9)  Jon Irabagon - saxophone solo (11)  Sean Wayland - vocals, keys  All compositons by Sean Wayland    Recording and mixing Engineers: Aya Takemura, Mike Marciano,  Jon Rosenberg, Nick Moran, Nate Wood, Sean Wayland  Mastered by Sean Wayland    www.seanwayland.com  Seed CD 020','seanwayland@gmail.com'),(39,'click track jazz volume 1 ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/clicktrack1.jpg','Recording Studios: Avatar, Systems Two, The Studio.  Recorded between 2007 and June 2012.  Sean\'s keyboards: Steinway piano, Fender rhodes 54,  Nord Modular G2X, Oberheim xpander,  Oberheim Matrix 1000, Hammond B3 organ,  Yamaha QY70.    Thanks to Qing, my family and the musicians.    Some of this music was composed for instruments  designed before 1975.  Some of this music is corny fusion music.     This CD was self-funded, including funds  generated from the sales of previous CDs recorded  and paid for by myself.   Back in 2001 I used to work in a mental institution in Queens New York as a music therapist. I worked with mostly black and hispanic teenagers who where dual diagnosis ( low IQ and mentally ill in some way also ). A good deal of them seemed to be only interested in Hip Hop and eating fried chicken. As an Australian growing up on a diet of Michael Jackson and the Cosby show it was quite a shock. The system was poorly funded and a lot of people working there...  more credits released October 22, 2013   Mark Guiliana - drums (1, 2, 3, 4, 6, 7, 8, 9, 10, 11)  Keith Carlock - drums (5, 13, 14)  Jeff Hanley - electric bass (1-13)  Alex Hewetson - electric bass (14)  Nate Wood - guitar  Isaac Darche - guitar solo (9)  Jon Irabagon - saxophone solo (11)  Sean Wayland - vocals, keys  All compositons by Sean Wayland    Recording and mixing Engineers: Aya Takemura, Mike Marciano,  Jon Rosenberg, Nick Moran, Nate Wood, Sean Wayland  Mastered by Sean Wayland    www.seanwayland.com  Seed CD 020','seanwayland@gmail.com'),(40,'click track jazz volume 2 ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/clicktrack2.jpg','released October 10, 2012   Sean Wayland: composer, keys, piano, mixing, mastering and engineering (all tracks) plus:   1. Mark Guiliana (dr), Matt Penman (b), Michael Valeanu (gt)  2. Mark Guiliana (dr), Matt Penman (b)  3. Mark Guiliana (dr), Matt Penman (b)  4. Mark Guiliana (dr), Matt Penman (b)  5. Orlando Leflemming (b), Jeff Hanley (electric b), Mark Guiliana (dr)  6. Mark Guiliana (dr), Matt Penman (b)  7. Mark Guiliana (dr)  8. Orlando LeFlemming (b), Mark Guiliana (dr), Michael Valeanu (gt)  9. Mark Guiliana (dr)  10. Jochen Rueckert (dr), Matt Penman (b)  11. Jeff Hanley (b), Keith Carlock (dr), Nate Wood (gt)  12. Matt Penman (b), Jochen Rueckert (dr)  13. Mark Guiliana (dr)    Recording and mixing Engineers: Aya Takemura, Mike Marciano,  Jon Rosenberg, Nick Moran, Nate Wood, Sean Wayland  Mastered by Sean Wayland   Cover image by Simon Ashton','seanwayland@gmail.com'),(41,'expensive habit ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/expensivehabit.jpg','released October 1, 2007   Engineer Jon Rosenberg  recorded at \" the studio \" in soho june 2006   jochen rueckert : drums  matt penman : bass  Will Vinson : alto  james muller : guitar   â€œSurging Darknessâ€ recorded 2002 at â€œOne Chookâ€ in Bondi.   Overdubs, mixing and mastering at home in Brooklyn.   Luca Benedetti (acoustic guitar) on â€œXpandaâ€   Nick â€œ3rd World manâ€ Mcbride (drums) on â€œSurging Darknessâ€   Keyboard instruments:   Steinway â€œBâ€ acoustic piano; Nord Modular G2 (all the synth solos except Grandma); Nord Electro ; Fender Rhodes 54 ; Oberheim Xpander; Yamaha QY70; Macintosh Computer   Big thanks to the fantastic musicians , Echo, my parents and family , Mike Sim , and Greg Segarra . Extra thanks to James Muller for many years of help and support.    â€œTrane plus Molly.. \" is an Australian joke about Coltrane telling Molly Meldrum what he is going to perform on the TV show. Grandmother Chord is my take on Olivier Messaienâ€™s 3rd mode of limited transposition. The title â€œGrandmother ..â€ is inspired by the story of Nicolas Slonimsky playing a gig with Frank Zappa on the Fender Rhodes. â€œArc Etudeâ€ is an Australian Rhythm Changes (although I think the American guy wins!). â€œOut they go\" is dedicated to Carl Orr. James Muller plays piano samples on â€œWayland Soloâ€ and â€œGrandmother Chord .. \" â€œJochen Computerâ€ was recorded at my house with Jochen playing along with my computer. I cant play that well yet. license all rights reserved','seanwayland@gmail.com'),(42,'fangin',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/fangin.jpg','eleased June 1, 1996   Recorded February 1996 at Electric Avenue Studios, Sydney   Sean Wayland Piano  Nick McBride Drums  Adam Armstrong Bass','seanwayland@gmail.com'),(43,'foodland',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/foodland.jpg','Sean Wayland ( keys ) Nate Wood ( drums ) Andrew Gander ( drums ) , Sam Minaie ( bass ) , Ben Eunson ( guitar ) , Kate KS (vocals) Recorded at Brooklyn Recording by Andy Taub 2014, Mixed and mastered by Sean Wayland ','seanwayland@gmail.com'),(44,'I am sun ',20,'2018-12-12','https://waylostreams.com/login-system/albumCovers/iamsun.jpg','feat Hamish Stuart, Alex Hewetson, James Muller, Arne Hanna, Lily Dior, Robynne Dunn, Jason Cooney, Nick Mcbride. Recorded at One Chook by Michael Bartolomei and Electric Ave by Phil Punch ','seanwayland@gmail.com'),(48,'lurline',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/lurline.jpg','jochen rueckert drums, matt penman bass. recorded in NYC 2001 at sound on sound studios. Engineer Jon Rosenburg ','seanwayland@gmail.com'),(49,'pistachio',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/pistachio.jpg','released October 1, 2008   Pistachio credits :   All bass, drums , guitar , piano , fender rhodes recorded at Avatar studios in 2 days in april 2008 . Engineer Aya Takemura  Keyboard overdubs, vocals , mixing , mastering done at home by Sean Wayland .  Software : Cubase studio 4 , PSP mastering compressor   Track Details :    Club Sandwhich :  Keith Carlock ( drums ) , Tim Lefebvre ( bass) , James Muller ( Rhythm guitar ) , Sean Wayland ( vocals , Steinway \" B\" , hammond C3 , fender rhodes , wurlitzer 200 , nord modular G2 synthesizer )   Arc is enough : Adam Rogers ( 1st guitar solo ) ; James Muller ( 2nd solo ) . Sean implements \"Samchilliean\" synth patch on Nord G2 based on relative keyboard concept by Leon Greunbaum   Soft Oz Rock; Jackie O ; Onit ; Dont Get me Wrong , Organic Cigs; Stuck in Oz : all played by Carlock , Le Febvre , Muller , Wayland   Be my Guest : Matt Clohesy ( Acoustic Bass ) ; Adam Rogers ( acoustic guitar ) Keith Carlock ( drums )   Drag out the Cliches : Sean Wayland ( Steinway \"B\" piano ) ; Adam Rogers ( Acoustic guitar )   John Coltrane : Sean Wayland ( live Steinway piano and overdubbed Hammond Organ Bass ) : Keith Carlock ( drums )   E of 1 : Sean Wayland , Adam Rogers, James Muller , Keith Carlock , Tim Lefebvre   Organic Cigarettes is a group improvisation . All other tracks composed by Sean Wayland  -- Pistachio is a mostly funky CD. It features Sean Wayland\'s compositions performed by an outstanding bunch of Jazz and Pop/Funk musicians. Keith Carlock plays drums, Tim Lefebvre plays electric bass, James Muller and Adam Rogers play guitar, Matt Clohesy plays acoustic bass on one track. Sean Wayland plays acoustic piano, fender rhodes, hammond C3 organ and synthesizers (oberheim Xpander, Nord Modular and others). The album was recorded in april at the famous Avatar Studios in New York and engineered by Aya Takemura. Overdubs, mixing and mastering were done by Sean in his home studio in Park Slope, Brooklyn. The starting premise of the CD was that it would be \"funk\" .. in composing music for the CD, Sean visited several genres including classic jazz-funk in the Herbie Hancock vein, Steely Dan sounding Pop music (with thanks to their drummer Keith Carlock), Wayne Krantz/Allan Holdsworth sounding adventurous synth-bending jazz fusion and contemporary classical music.  It\'s interesting music, excellently played and recorded. The level of musicianship and sonic artistry is magnificent. Overall it\'s a quirky album, with familiar grooves and concepts taken to different places, and updated by their juxtaposition with opposite styles in the one CD. Surf your way from jazz/funk to funk to rock to bebop to contemporary classical in just over one hour.','seanwayland@gmail.com'),(50,'pistachio 2 ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/pistachio2.jpg','recorded at avatar april 2008 : engineer Aya Takemura  track 6 and 12 recorded at \" once chook \" in sydney 2004  engineer Michael Bartolomei  track 8 recorded at electric ave sydney 2005  engineer Phil Punch  keyboard overdubs , mixing and mastering by Sean Wayland at home in Brooklyn  track 13 recorded at home  watch recording of 13 here  www.youtube.com/watch?v=GB-e1sKy-h8 credits released September 1, 2009   keith carlock : drums : 1 , 2 , 3 , 5 , 7 , 9 , 11  tim le febre : bass : 1 , 2 , 3 , 5 , 7 , 9 , 11  james muller : guitar : 6 , 7 , 11 , 12  tim miller : guitar : 5  nick mcbride : drums : 6 , 12  andrew gander : drums : 8  adam rogers : guitar : 4  Mark Ferber : track 13    Sean Wayland : steinway B piano , fender rhodes 54 , oberheim xpander , nord modular G2X synthesizer , hammond C3','seanwayland@gmail.com'),(51,'play live random choice live at 55 bar feat nate wood ',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/playliverandomâ€‹â€‹choiceâ€‹.jpg','Matt Marantz plays ewi pads on boxing day and Onya. Some tracks whre recorded with a samsung galaxys7 phone. Some with a zoomQ3HD video recorder. Audio engineer Qing Shen. Mastered by Sean Wayland credits released July 1, 2017   Sean Wayland  Nate Wood  Sam Minaie  Orlando Leflemming  Matt Marantz','seanwayland@gmail.com'),(52,'show must go on',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/southpacificsoul.jpg','This CD was recorded around 2000 in Australia and New York. It features Seamus Blake, James Muller, Alvester Garnett, Jochen Rueckert and Matt Penman. Sean sings a little bit on the first track which has a repetive drum figure reminiscent of African music. The 2nd track \"Shaun\" has an Oz-Rock beat and a great guitar solo by James Muller. Other tracks feature Sean on Fender Rhodes piano and keyboards as well as piano. \"VB\" is dedicated to Australian beer \" Victoria Bitter\" . Sean and James Muller experiment and improvise together in an electric free from setting. Some of Sean\'s favorites of his own tunes ..... credits released January 1, 2003   nick mcbride ( drums ) : 1 , 2 , 3 , 5 , 6 , 8 , 9 , 11  greg gonzales ( drums ) : 4  alvester garnett ( drums ) : 7 , 10  jochen rueckert ( drums ) : 12  james muller ( guitar ) : 2 , 4 , 5 , 9 , 11  matt penman ( bass ) : 12  Brett Hirst ( bass ) : 2 , 5 , 6 , 7 , 9  adam armstrong ( bass ) , peter zografakis ( guitar ) : 3  hamish stuart ( drums ) 1  mike davis ( bass) 4  seamus blake ( tenor ) : 7','seanwayland@gmail.com'),(53,'stevo',20,'2018-12-12','https://waylostreams.live/login-system/albumCovers/stevo.jpg','released December 1, 1997   Sean hits the Big Apple for the first time and records with a stellar rhythm section of Adam Nussbuam (drums) and Dennis Irwin (bass). Sean patented the use of the \"one harness\" in this album of original music dedicated to his now defunct car. Stevo was destroyed in the great hail of \'99','seanwayland@gmail.com'),(54,'south pacific soul',20,'2018-12-13','https://waylostreams.live/login-system/albumCovers/southpacificsoul.jpg','This CD was recorded around 2000 in Australia and New York. It features Seamus Blake, James Muller, Alvester Garnett, Jochen Rueckert and Matt Penman. Sean sings a little bit on the first track which has a repetive drum figure reminiscent of African music. The 2nd track \"Shaun\" has an Oz-Rock beat and a great guitar solo by James Muller. Other tracks feature Sean on Fender Rhodes piano and keyboards as well as piano. \"VB\" is dedicated to Australian beer \" Victoria Bitter\" . Sean and James Muller experiment and improvise together in an electric free from setting. Some of Sean\'s favorites of his own tunes ..... credits released January 1, 2003   nick mcbride ( drums ) : 1 , 2 , 3 , 5 , 6 , 8 , 9 , 11  greg gonzales ( drums ) : 4  alvester garnett ( drums ) : 7 , 10  jochen rueckert ( drums ) : 12  james muller ( guitar ) : 2 , 4 , 5 , 9 , 11  matt penman ( bass ) : 12  Brett Hirst ( bass ) : 2 , 5 , 6 , 7 , 9  adam armstrong ( bass ) , peter zografakis ( guitar ) : 3  hamish stuart ( drums ) 1  mike davis ( bass) 4  seamus blake ( tenor ) : 7','seanwayland@gmail.com'),(55,'groovive',22,'2018-12-13','https://waylostreams.live/login-system/albumCovers/banana.jpg','released January 1, 1993   Acid Jazz ! Sean Wayland , Simon Ashton , Cameron Undy, Peter Zografakis, Lily Dior ( 2 , 8 ) , Kristen Cornwell ( 2) Jason Raiss ( 7 ) , Jason Cooney , Andrew Robson ( 11 ) and Jason Klaffer . Original Australian Compositions . First released 1993  recorded by tom blaxland at EMI studio 301 license','seanwayland@gmail.com'),(56,'the show must go on',20,'2018-12-14','https://waylostreams.com/login-system/albumCovers/showmustgoon.jpg','\"The show must go on\" (SEED CD 016) is Sean Wayland\'s new piano trio CD recorded in New York with his long standing acoustic trio of Jochen Rueckert (drums) and Matt Penman (bass). This trio has been performing and recording in New York and worldwide for over 10 years.   This CD follows on from previous trio CDsâ€Colossus of Rhodes\" (DIW label), \"Lurline\" (Seed). The trio also was featured on Sean\'s CD â€œExpensive Habit\".  The music is mostly swinging and features a large number of cover tunes mixed with Sean\'s distinctive compositions. Highlights include a version of \"Strawberry Fields Foreverâ€ by the Beatles and a version of Australian Saxophonist Bernie McGann tune â€œD-dayâ€ which is based on the chord progression to \" My Secret Loveâ€. Also included is Sean\'s readapting of standard jazz vehicles Giant Steps and Rhythm Changes which are infused with his own personal brand of rhythm and harmony .   As a sonic change the last 2 tracks feature Sean\'s adept use of electronics and synthesizers.   Overall it\'s a sunny swinging CD with familiar sounds and tradition mixed with new ideas.   It\'s beautifully recorded by engineer Aya Takemura at New York\'s top studios Avatar and Sear Sound which both have excellent Steinway pianos. The album is sonically very pleasing recording live to 2-track digital.   As always Matt Penman and Jochen Rueckert provide excellent support, musicianship, and creativity. The trio continues to develop an original, swinging approach to group interplay.  credits released May 28, 2010','seanwayland@gmail.com');
